import React from "react";
// import "./Header.css";

const Header = () => (
  <header className="header">
    <div className="logo"><img src="logonew.svg"></img></div>
    <nav className="nav">
      <ul>
        <li>Home</li>
        <li>Jobs</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
    <button className="signup-btn">Sign Up</button>
  </header>
);

export default Header;
